import React from "react";

export const GeneratedMeme = ({ template }) => {
  return (
    <img
      style={{
        borderWidth: 3,
        borderRadius: 20,
        maxWidth: 150,
        maxHeight: 150,
      }}
      alt="custom meme"
      key={template.id}
      src={template.url}
    />
  );
};
